import "../App.css";
import React from 'react';

const SearchBar = (props) => {
    return (
        <>
        <form className="form">
          <div className="search_container">
            <h3 className="container">Search Your Emojis</h3>
            <input placeholder="Search" className="Search input"></input>
            <button className="Search_button" type="submit" handleChange={() => props.emojis}><i></i></button>
          </div>
        </form>
        </>
    );
  };


export default SearchBar;
